import React from 'react'
import { ArrowBackIos, ArrowForwardIos } from '@mui/icons-material'

const Container=styled.div`
    width:100%;
    height:100vh;
    display:flex;
`
const Arrow=styled.div`
width: 50pxx;
height:50px;
background-color: #fff7f7;
border-radius: 50%;

`
const slider = () => {
  return (
    <Container>
        <Arrow>
            <ArrowBackIos/>
            <ArrowForwardIos/>
        </Arrow>
    </Container>
  )
}

export default slider
